import React from 'react'
import './home.css'
import img2 from './img/home.jpeg';
import Product from './product'
import img3 from './img/book1.jpeg';
import img4 from './img/book2.jpeg';
import img5 from './img/book3.jpg';
import img6 from './img/book4.jpeg';
import img7 from './img/book5.jpg';

function home(){

    return (


        <div className='Home'>
            <div className='home_container'>
                <img className='Home_image' src={img2} alt=""/>


                <div className='home_row'>
                    <Product title="Atomic Habits" image= {img3} price= {11}/>
                    <Product title="Think like a monk" image={img4} price = {13}/>
                    <Product title="It starts with us" image={img5} price = {14}/>
                    <Product title="lighter" image={img6} price = {12}/>

                </div>
                <div className='home_row'>
                    <Product title= "The light we carry" image = {img4} price = {18}/>
                    <Product title= "It Ends with us" image= {img5} price= {15}/>
                    <Product title="It ends with us" image = {img6} price= {13}/>
                    <Product title= "spare" image = {img7} price = {11}/>

                </div>
                <div className='home_row'>
                    <Product title = "Power" image= {img8} price = {19.22}/>
                    <Product title = "Reminders of him" image= {img9} price = {20.12}/>
                    <Product title = "Seven Husbands" image= {img10} price = {12.32}/>
                    <Product title ="Harry Potter" image={img11} price = {15.14}/>
                 </div>

            </div>
        </div>

    );
}

export default home;
